"original": |2-
     o  'unsupported-document-format': The Job was aborted by the system
        because the Document data's "document-format" attribute is not
        among those supported by the Printer.  If the Client specifies
        "document-format" as 'application/octet-stream', the Printer MAY
        abort the Job and post this reason even though the
        "document-format" value is among the values of the Printer's
        "document-format-supported" Printer attribute but not among the
        auto-sensed Document formats.  This value MUST be supported, since
        "document-format" is a REQUIRED operation attribute.
"fixed": |-
  -  'unsupported-document-format': The Job was aborted by the system because the Document data's "document-format" attribute is not among those supported by the Printer.  If the Client specifies "document-format" as 'application/octet-stream', the Printer MAY abort the Job and post this reason even though the "document-format" value is among the values of the Printer's "document-format-supported" Printer attribute but not among the auto-sensed Document formats.  This value MUST be supported, since "document-format" is a REQUIRED operation attribute.
"ko": |-
  - 'unsupported-document-format': 문서 데이터의 "document-format" 속성이 프린터에서 지원되는 속성이 아니기 때문에 시스템에서 작업이 중단되었습니다. 클라이언트가 "document-format"을 'application/octet-stream'으로 지정하는 경우, 프린터는 "document-format" 값이 프린터의 "document-format-supported" 값 중 하나임에도 불구하고 작업을 중단하고 이 이유를 게시할 수 있습니다. " 프린터 속성이지만 자동 감지된 문서 형식에는 포함되지 않습니다. "document-format"은 필수 작업 속성이므로 이 값은 반드시 지원되어야 합니다.
